import React from 'react';
import LoadPage from './views/LoadPage';
import Header from './components/layout/Header';
import Logo from './components/Logo'
import Sand from './assets/vehicles/sandcrawler.png'
import Button from './components/Button';
import Card from './components/Card';
import CardCheckout from './components/CardCheckout';
import PaymentType from './components/PaymentType';
import SmallInput from './components/SmallInput';
import Policy from './components/Policy';
import EmailCheckbox from './components/EmailCheckbox';
import robots from './assets/robots.svg'
import TrustCheckout from './components/TrustCheckout';
import GoodBuy from './views/GoodBuy';
import ToastWarning from './components/ToastWarning';
import LargeInput from './components/LargeInput';

function App() {
  return (
    <div>
      <div className="fixed z-40 w-screen">
        <Header />
      </div>
        <div className="h-24"></div>
      <div className="flex flex-col 
                      justify-center 
                      items-center 
                      w-screen 
                      overflow-x-hidden 
                      pb-12
      ">
        <form>
          <div className="space-y-8 mt-12">
            <div className="space-y-8 md:space-x-8 md:flex md:flex-row">

              <div>
                <div className="mt-6 w-full flex justify-center">
                  <TrustCheckout />  
                </div>
                <CardCheckout img={Sand} 
                              alt={'asd'} 
                              price={140000} 
                              name={'Hello'} 
                              company={'asdas'} 
                />
              </div>

                <div className="space-y-8">
                  <div className="mt-6 w-full flex justify-center">
                    <PaymentType />
                  </div>
                    <LargeInput label={'Número do Cartão'}                
                                typed={'number'}
                    />
                      <LargeInput label={'Nome Impresso'}                  
                                  typed={'text'}
                      />
                    <div className="w-80 flex justify-between">
                      <SmallInput label={'CVV'}                  
                                  typed={'number'}
                      />
                        <SmallInput label={'Validade'}                  
                                    typed={'text'}
                        />
                    </div>
                </div>
            </div>
              <div className="text-2xl w-80 md:w-full text-center text-green-500">
                <h1>
                  Preencha seus dados para adquirir o seu veículo:
                </h1>
              </div>
            <div className="space-y-8 flex flex-row">
              <div className="space-y-8">
                <LargeInput label={'Nome'}                
                            typed={'text'}
                />
                  <LargeInput label={'Sobre Nome'}
                        typed={'text'}
                  />
                    <LargeInput label={'Email'}
                                typed={'text'}
                    />
                  <LargeInput label={'CPF/CNPJ'}
                              typed={'text'}
                  />
                <LargeInput label={'CEP'}
                            typed={'number'}
                />
              </div>
              <div className="space-y-8">
                <LargeInput label={'Endereço'}
                              typed={'text'}
                />
                  <div className="w-80 flex justify-between">
                    <SmallInput label={'Número'}                  
                                typed={'number'}
                    />
                      <SmallInput label={'Complemento'}                  
                                  typed={'text'}
                      />
                  </div>
                    <LargeInput label={'Cidade'}
                                typed={'text'}
                    />
                  <LargeInput label={'Bairro'}
                              typed={'text'}
                  />
                <LargeInput label={'Estado'}
                            typed={'text'}
                />
              </div>
            </div>

                  <Policy />
                <EmailCheckbox />
              <div className="w-full flex justify-center">
                <Button txt={'COMPRAR'} />
              </div>
            </div>
          </form>

      </div>
    </div>
  );
}

export default App;
